classDescription:
теплоход-пансионат (к услугам массаж, лечебная физкультура, фиточай, кислородный коктейль и др.);
питание в одну смену;
завтрак — буфет («шведский стол») фиксированная рассадка;
обед — буфет («шведский стол») фиксированная рассадка, в отдельные дни круиза возможна замена на обед с выбором блюд;
ужин — заказная система, к ужину — на выбор: бокал вина/ бокал пива/ бокал сока/ вода;
приветственный коктейль;
в каюте — бутилированная питьевая вода (в день посадки);
гигиенический набор в каютах (мыло, шампунь, гель для душа, шапочки для душа);
холодильники, телевизоры, фены во всех каютах;
специально оборудованный детский клуб.

